import React from 'react';
import Filter from './Filter';
import Cardlist from './Cardlist';

const App = () => {


    const skillClick = (event) =>{
        console.log(event.target.getAttribute('name'));
    }

    return(
        <div>
       <div className='image'></div>
       <Filter/>
       <Cardlist click={skillClick}/>
        </div>
    )
}

export default App;
